<article id=""aboutme"">
    <p>
        Programozói magántanítást vállalok:
        <ul>
            <li>Alapoktól felépítve,</li>
            <li>Korrepetálásként emelt infó érettségihez, OKJ-s képzéshez, akár főiskolai/egyetemi feladathoz vagy releváns tárgyhoz, utóbbi attól függ pontosan mihez kell a segítség, illetve hogy az iskolád mit ír az adott tárgyról,</li>
            <li>Egyedi igény szerinti mentorálás keretében</li>
        </ul>
    </p>

    <p>
        A nyelvek amiket a leginkább ismerek a C, C++, C#, Java (SE). Valamennyi tapasztalatom az SQL, HTML-CSS-JavaScript nyelvekben, az ASP.NET Core MVC technológiában, illetve kis limitált tudásom van a PHP ban is.
    </p>
    <p>
        Teamviewer vagy Skype segítségével is szívesen oktatok abban az esetben ha nem tudunk máshol találkozni.
    </p>
    <p>
        Weboldal, portfólió:<br>
        https://nusstudios.com/Home/Edu
    </p>
    <p>
        +36702889403<br>
        patrik.nusszer@icloud.com
    </p>
    <p>
        Ha szeretnél elkezd");
            WriteLiteral(@"eni programozni, és keresel egy stabil pontot, akkor át tudom adni amire szükséged van.
    </p>
    <p>
        A hangsúly pedig nem a lexikális részén van, hanem a nyelvektől független (nyelvagnosztikus) algoritmikus gondolkodáson, amelyet minden programozó elsajátít az évek alatt mire rájön, hogy legalapvetőbb építőelemeiket tekintve majdnem az összes nyelv ugyanolyan, méghozzá több mint 20 éve.
    </p>
    <p>
        Azóta több paradigma is született, de a legfontosabb, hogy a megoldásunk fő logikáját még mindig a strukturált programozási paradigma elemeivel oldjuk meg. Az ő utána következők - ahogy ősei is - nem alternatív megközelítések, hanem az előzőnek a kibővítése, hogy a projektjeinket még rendszerezettebbé, protokollosabbá, újrafelhasználhatóbbá és absztraktabbá tegyük, amely a nagyvállalati méretű projektet hosszú távú könnyű bővíthetőségén segít.
    </p>
    <p>
        A nyelvek egymástól bizonyos részletekben térnek csak el, amely miatt esetleg van amelyik adekváltabb egy olyan feladatra am");
            WriteLiteral(@"elyre a másik kevésbé, esetleg az egyik az egyszerűségre törekszik, a másik alacsonyabb szintű és több kontrollt ad a kezünkbe, a másik átmenet a kettő között, szintaktikailag is kicsit mások, illetve a paradigmákról is esetleg apróságokban más lehet a véleményük, de alapvetően megegyeznek legfontosabb elemeikben.
    </p>
    <p>
        Nagyjából minden programozói tanterv része alapvetőbb ismert algoritmusok bemutatása (mintaillesztés/rendezés/útvonalkeresés gráfokban/visszalépéses keresés), ismert fontosabb adatszerkezetek belülről (önkiegyensúlyozó bináris keresőfák, hasítótáblák, 1 és többdimenziós tömbök, tömblista, láncolt lista, gráfok), a strukturált paradigma elemei (elágazás/ciklus/szekvencia/viselkedés és állapot), algoritmusok írása/problémamegoldás, objektum orientált modellezés (futásidejű polimorfizmus/öröklődés/egységbezárás és társai), regular expressions, szöveges fájlkezelés, illetve alacsony szintű fájlkezelés. Ezek azok amikben biztosan tudok segíteni, természetesen ha akad más, kérdezz");
            WriteLiteral(" rá tudom-e vállalni.\n    </p>\n    <p>\n        22 éves vagyok, 16 éves korom óta kizárólag magamat tanítva jutottam el idáig, és így valóvilágbeli problémákon keresztül szereztem a tapasztalataimat.\n    </p>\n</article>\n</p>");
